                        "Name": "Мяутеоритный удар",
                        "Desc": "<color style='color:#FFD780;'>Быстрое нажатие</color><br>Подпрыгивает в воздух с ловкостью мчащейся через кусты кошки и больно бьёт противников, нанося <color style='color:#99FF88;'>Дендро урон по площади</color>. Также развёртывает Щит безопасной перевозки и на короткое время получает <color style='color:#99FF88;'>эффект Дендро</color>. Щит безопасной перевозки поглощает <color style='color:#99FF88;'>Дендро урон</color> с 250% эффективностью. Поглощаемый щитом урон зависит от макс. HP Кирары и не превышает определённого процента от него. Оставшийся поглощаемый урон Щита безопасной перевозки при создании нового щита суммируется с ним, а его длительность обновляется.<br><br><color style='color:#FFD780;'>Долгое нажатие</color><br>Следуя рвению «доставить за полдня», создаёт такой же Щит безопасной перевозки, как и при коротком нажатии, сворачивается калачиком в специальном ящике для экспресс-доставки и переходит в состояние Срочной посылки нэко, чтобы передвигаться и сражаться ещё быстрее.<br><br><color style='color:#FFD780;'>Срочная посылка нэко</color><br> ·  Наносит <color style='color:#99FF88;'>Дендро урон</color> противникам, в которых врезается. Этот эффект может возникнуть один раз в 0,5 сек. для каждого врага.<br> ·  В этом состоянии скорость передвижения, скорость карабканья и сила прыжка Кирары увеличены, а при карабканье она тратит больше энергии.<br> ·  После истечения времени действия или повторной активации навыка выполняет Удар когтями, который наносит <color style='color:#99FF88;'>Дендро урон по площади</color>. Этот удар сильнее атаки при коротком нажатии навыка.<br> ·  Состояние Срочной посылки нэко длится до 10 сек., после чего переходит в режим отката. Чем дольше Кирара пребывает в этом состоянии, тем дольше откат.<br> ·  Спринт или произвольное завершение карабканья прерывает это состояние.<br><br><i>«Хотите знать, в чём секрет такой быстрой доставки? В силе ног, конечно же!»</i>",
